// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

struct NFTState {
    // immutable states
    string workId;
    uint8 royalty;
    address royaltyReceiver; // TODO; for management purpose it may be mutable in some condition
    // mutable states
    bool isTrading;
    uint256 price;
    // mutable but only mutated by contract
    bool resale;
}

contract Tamtam is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;
    uint256 public mintFee;

    mapping (uint256 => NFTState) _nftStateMap;

    constructor(uint256 initMintFee) ERC721("Tamtam", "TAMTAM") {
        mintFee = initMintFee;
    }

    function equalString(
        string storage a,
        string calldata b
    )
        internal pure
        returns (bool)
    {
        return keccak256(abi.encodePacked(a)) == keccak256(abi.encodePacked(b));
    }

    function nftState(uint256 tokenId) external view returns (NFTState memory) {
        require (_exists(tokenId), "target token does not exist");
        return _nftStateMap[tokenId];
    }

    function setMintFee(uint256 newMintFee) external onlyOwner() {
        mintFee = newMintFee;
    }

    function setNFTState(
        uint256 tokenId,
        NFTState calldata state1
    )
        external
    {
        require (_exists(tokenId), "target token does not exist");
        require (msg.sender == ownerOf(tokenId), "only owner can set NFT state");

        NFTState storage state0 = _nftStateMap[tokenId];
        require (equalString(state0.workId, state1.workId), "modifying workId is forbidden");
        require (state0.royalty == state1.royalty, "modifying royalty is forbidden");
        require (state0.royaltyReceiver == state1.royaltyReceiver, "modifying royalty receiver is forbidden");
        require (state0.resale == state1.resale, "modifying resale is forbidden");
        require (state1.price > 99 || state1.price == 0, "price must be zero or more than 99 wei");

        _nftStateMap[tokenId] = state1;
    }

    function transferEther(address to, uint256 amount) internal {
        (bool success, ) = to.call{value: amount}("");
        require (success, "failed to transfer ether");
    }

    function mint(
        address tokenOwner,
        string calldata workId,
        uint8 royalty,
        address royaltyReceiver,
        string calldata uri
    )
        external payable
        returns (uint256)
    {
        require (msg.value == mintFee, "sent value does not match mint fee");
        require (royalty < 11);

        _tokenIdCounter.increment();
        uint256 tokenId = _tokenIdCounter.current();

        _safeMint(tokenOwner, tokenId);
        _setTokenURI(tokenId, uri);
        _nftStateMap[tokenId] = NFTState({
            workId: workId,
            royalty: royalty,
            royaltyReceiver: royaltyReceiver,
            isTrading: false,
            price: 0,
            resale: false
        });

        transferEther(owner(), msg.value);

        return tokenId;
    }

    function calcIntegerFee(uint256 price, uint8 percent)
        internal pure
        returns (uint256)
    {
        if (percent == 0) {
            return 0;
        }
        /* 1. `price` is guaranteed to be larger than 99 (<= 100)
         * 2. `percent` is guaranteed to be 0 ~ 10
         *    1. 0 ~ 10 when calculating creator royalty
         *    2. 5 when calculating first sale platform fee
         *    3. 2.5 when calculating resale platform fee; this case MUST use
         *       `calcResaleFee` function instead
         * 3. decimal point is dropped */
        return price / 100 * percent;
    }

    function calcFirstSaleFee(uint256 price) internal pure returns (uint256) {
        return calcIntegerFee(price, 5);
    }

    function calcResaleFee(uint256 price) internal pure returns (uint256) {
        // Solidity does not provide floating number operations
        return calcFirstSaleFee(price) / 2;
    }

    function buyNFT(uint256 tokenId) external payable {
        require (_exists(tokenId), "target token does not exist");

        // TODO; benchmark if using `memory` costs less
        NFTState storage state = _nftStateMap[tokenId];
        require (state.isTrading, "target token is not for sale");
        require (msg.value == state.price, "sent value does not match token price");

        uint256 creatorRoyalty = calcIntegerFee(state.price, state.royalty);
        uint256 platformFee;
        if (state.resale) {
            platformFee = calcResaleFee(state.price);
        } else {
            platformFee = calcFirstSaleFee(state.price);
            state.resale = true;
        }
        uint256 payment = msg.value - creatorRoyalty - platformFee;

        address seller = ownerOf(tokenId);
        address to = msg.sender;
        address creator = state.royaltyReceiver;

        state.isTrading = false;
        state.price = 0;

        bytes memory data;
        _safeTransfer(seller, to, tokenId, data);

        transferEther(creator, creatorRoyalty);
        transferEther(seller, payment);
        transferEther(owner(), platformFee);
    }

    function _beforeTokenTransfer(
        address /* from */,
        address /* to */,
        uint256 tokenId
    ) internal view override {
        require (!_nftStateMap[tokenId].isTrading);
    }
}
